import React from 'react';
import  {add ,sub,mul,div} from './Cal';

function App(){

    return(
<>


<ul>
      <li>sum of two no={add(30,5)}</li>
      <li>sum of two no={sub(30,5)}</li>
      <li>sum of two no={mul(30,5)}</li>
      <li>sum of two no={div(30,7)}</li>
     
    </ul>

</>);
}
export default App;
